import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import GreetingsScreen from './screens/GreetingsScreen';
import MainUnauthScreen from './screens/MainUnauthScreen';
import AuthScreen from './screens/AuthScreen';
import RegScreen from './screens/RegScreen';
import ForgotScreen from './screens/ForgotScreen';

const StackNavigator = createStackNavigator(
  {
    Greetings: { screen: GreetingsScreen },
    MainUnauth: { screen: MainUnauthScreen },
    Auth: { screen: AuthScreen },
    Reg: { screen: RegScreen },
    Forgot: { screen: ForgotScreen },
  },
  {
    initialRouteName: 'Greetings',
  },
);

const AppContainer = createBrowserApp(StackNavigator);

export default function App() {
  return <AppContainer />;
}
